import React, { useState } from "react";
import Button from '@material-ui/core/Button'


const USeEfct = (()=>{
    const [num , SetNum] = useState(0)

    const inc = (()=>{
        SetNum(num+1)
    }) 
    return (<Button onClick={inc}>{num}</Button>)

})
export default USeEfct
